    core_user.type,
        CASE
            WHEN ((core_user.type)::text = 'api-key'::text) THEN NULL::public.citext
            ELSE core_user.email
        END AS email,
    core_user.first_name,
    core_user.last_name,
    (((core_user.first_name)::text || ' '::text) || (core_user.last_name)::text) AS full_name,
